import React, { Fragment } from 'react'

const Report = ({ message, handleClick }) => {
  return (
    <a onClick={handleClick} className="report">
      <p>{message['INCIDENT TITLE']}</p>
      <p>{message['LOCATION']}</p>
      <p>{message['INCIDENT DATE']}</p>
      <p>
        Category:{' '}
        {message.CATEGORY.split(',').map(desc => (
          <span className="category">{desc} | </span>
        ))}
      </p>
    </a>
  )
}

const Reports = props => {
  const reports = this.props.messages.map(report => (
    <Report
      key={report.id}
      message={report}
      handleClick={handleDisplay}
      data-id={report['#']}
    />
  ))

  return (
    <div className="row">
      <div>{reports}</div>
      <div className="detailsBox">
        <h1>Testing</h1>
      </div>
    </div>
  )
}
export default Reports
